  async setUsername(username) {
    await this.inputUsername.setValue(username);
  }

  async setPassword(password) {
    await this.inputPassword.setValue(password);
  }

  // Methods
  async login(username, password) {
    await this.inputUsername.setValue(username);
    await this.inputPassword.setValue(password);
    await this.btnLogin.click();
  }

